runDevelopmentMainDatabase: false
runDevelopmentKeycloakDatabase: false
accessionPrefix: "PPD_"
bannerMessage: "This is a demo instance. You can upload any data you like, including test data to try things out. You can find test data to upload in the <a href='https://pathoplexus.github.io/example_data/' class='font-semibold underline'>example data</a> repository. This instance should not be used for analysis."
secrets:
  keycloak-admin:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      initialAdminPassword: ""
  service-accounts:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      backendUserPassword: 
      externalMetadataUpdaterPassword: 
      insdcIngestUserPassword: 
      preprocessingPipelinePassword: 
      siloImportJobPassword: 
  database:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      host: 
      password: 
      url: 
      username: 
  keycloak-database:
    type: sealedsecret
    clusterWide: "true"
    encryptedData:
      addr: 
      database: 
      password: 
      port: 
      username: 
podPriorityClassName: staging